ground_truth_full:
Since $M$ is the midpoint of $\overline{BC},$ we have $BM = MC = \frac{BC}{2}.$
Let $x = BM = MC.$  Then $AF = \frac{x}{6}$ and $AE = \frac{2x}{8} = \frac{x}{4}.$

Since $AE = 2AF,$ $\frac{x}{4} = 2 \cdot \frac{x}{6} = \frac{x}{3},$ so $x = 12.$

[asy]
unitsize(0.3 cm);

pair A, B, C, E, F, G, M;
real x = 4;

B = (0,0);
C = (18,0);
A = intersectionpoint(arc(B,12,0,180),arc(C,16,0,180));
M = (B + C)/2;
F = interp(A,B,x/12);
E = interp(A,C,2*x/16);
G = extension(E,F,A,M);

draw(A--B--C--cycle);
draw(E--F);
draw(A--M);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$E$", E, NE);
label("$F$", F, NW);
label("$G$", G, SW);
label("$M$", M, S);
[/asy]

Then $AF = 2$ and $AE = 3,$ so by similar triangles, $\frac{EG}{GF} = \frac{AE}{AF} = \boxed{\frac{3}{2}}.$
The answer is: \frac{3}{2}

