We have
\begin{align*}
\sin 6^\circ \sin 42^\circ \sin 66^\circ \sin 78^\circ &= \sin 6^\circ \cos 12^\circ \sin 66^\circ \cos 12^\circ \\
&= \frac{1}{2} \sin 12^\circ \sin 66^\circ \cos 12^\circ \\
&= \frac{1}{4} \sin 24^\circ \cos 24^\circ \\
&= \frac{1}{8} \sin 48^\circ \\
&= \frac{1}{8} \cdot \frac{1}{2} \\
&= \boxed{\frac{1}{16}}.
\end{align*}
The answer is: \frac{1}{16}

