ground_truth_full:
The region is a rectangle with dimensions of 2 by 1, so its area is 2.
To determine the points that are closer to the origin than to $(3,1)$, we draw the perpendicular bisector of the line segment connecting the origin and $(3,1)$.
This perpendicular bisector is the line $x = \frac{3}{2}$.
The points that are closer to the origin lie to the left of this line.
The shaded region represents the points that are closer to the origin.
[asy]
draw((0,0)--(2,0)--(2,1)--(0,1)--cycle);
draw((3/2,-1)--(3/2,2),red);
fill((0,0)--(2,0)--(2,1)--(0,1)--cycle,gray(0.7));
dot((3/2,1/2));
dot((3/2,0));
label("$(3,1)$",(3/2,1/2),N);
label("$(3/2,0)$",(3/2,0),S);
[/asy]
The shaded region is a trapezoid with a height of 1 and bases of length 1 and 1.5.
So, its area is $\frac{1}{2}(1+1.5)(1)=\frac{3}{2}$.
Therefore, the probability that a randomly selected point is closer to the origin than to $(3,1)$ is $\frac{\frac{3}{2}}{2}=\boxed{\frac{3}{4}}$.
The answer is: \frac{3}{4}

