We complete the square on each equation to get
\begin{align*}
x^2 + y^2 - 4x + 2y - 11 &= 0 \\
(x - 2)^2 + (y + 1)^2 &= 16
\end{align*}and
\begin{align*}
x^2 + y^2 - 14x + 12y + 60 &= 0 \\
(x - 7)^2 + (y + 6)^2 &= 25.
\end{align*}The first equation represents a circle centered at $(2,-1)$ with radius 4, and the second equation represents a circle centered at $(7,-6)$ with radius 5.

[asy]
unitsize(0.4 cm);

pair A, B;

A = intersectionpoint(Circle((2,-1),4),Circle((7,-6),5));
B = intersectionpoint(Circle((2,-1),4),Circle((7,-6),5));

draw(Circle((2,-1),4));
draw(Circle((7,-6),5));
draw((-2,0)--(12,0));
draw((0,-10)--(0,4));
draw(A--B);

dot("$A$", A, S);
dot("$B$", B, N);
