Since the two circles intersect, the line joining the centers of the circles (which is the line joining $(2,-1)$ and $(7,-6)$) must be perpendicular to the line joining the points of intersection.  The slope of the line joining $(2,-1)$ and $(7,-6)$ is $\frac{-6 - (-1)}{7 - 2} = -1,$ so the slope of the line joining the points of intersection is $\boxed{1}.$
The answer is: 1

